function rechercheCle(cle){
	var regex=/,/;
	for(i=0;i<Json.length;i++){
		if(regex.test(Json[i].clé))Json[i].clé=Json[i].clé.substring(0,Json[i].clé.length-2);
		if(Json[i].clé==cle)return i;
	}
	return -1;
}

function ecritureRes(indice){
	lien="https://dblp.uni-trier.de/search?q=";
	if (indice==-1)document.getElementById("tab").innerHTML="aucun résultats";
	else{

		var regex=/,/;
		for(i=0;i<Json[indice].similitude.length;i++){
			if(regex.test(Json[indice].similitude[i].clé_sim))Json[indice].similitude[i].clé_sim=Json[indice].similitude[i].clé_sim.substring(0,Json[indice].similitude[i].clé_sim.length-2);
			document.getElementById("tab").innerHTML+=Json[indice].similitude[i].clé_sim+"<br>";
			if(i==0)lien+=Json[indice].similitude[i].clé_sim;
			else{
				if(i<8)lien+="|"+Json[indice].similitude[i].clé_sim;
			}
		}
	}
	console.log(lien);
	lien=lien.replace(/ /g,"|");
	console.log(lien);
	document.getElementById("lien").innerHTML="<a href="+lien+">Cliquez ici</a>";
}

// Exécute un appel AJAX GET
// Prend en paramètres l'URL cible et la fonction callback appelée en cas de succès
function ajaxGet(url, callback) {
    var req = new XMLHttpRequest();
    req.open("GET", url);
    req.addEventListener("load", function () {
        if (req.status >= 200 && req.status < 400) {
            // Appelle la fonction callback en lui passant la réponse de la requête
            callback(req.responseText);
        } else {
            console.error(req.status + " " + req.statusText + " " + url);
        }
    });
    req.addEventListener("error", function () {
        console.error("Erreur réseau avec l'URL " + url);
    });
    req.send(null);
}

function afficher(reponse) {
    Json=JSON.parse(reponse);
}
